function dataTable(tblId, nameReport, varData = '') {
    $(tblId).DataTable().destroy();
    $(function () {
        var dataTable = $(tblId).DataTable({
            lengthMenu: [
                [10, 15, 20, -1],
                [10, 15, 20, "All Records"]
            ],
            destroy: true,
            responsive: true,
            paging: true,
            dom:
                    "<'row col-md-12'<'col-sm-12 col-md-4 text-left'l><'col-sm-12 col-md-4 text-center'B><'col-sm-12 col-md-4 text-right'f>>" +
                    "<'row'<'col-sm-12'tr>>" +
                    "<'row'<'col-sm-12 col-md-5'i><'col-sm-12 col-md-7'p>>",
            language: {
                url: baseUrl + '/resources/plugins/dataTables/languaje.json'
            },
            buttons: [
                {
                    extend: 'colvis',
                    text: '<i class="fa-regular fa-list"></i> COLUMNAS ',
                    titleAttr: 'COLUMNAS VISIBLES',
                    className: 'btn btn-system-2 btn-sm',
                    columns: ':not(.noVis)'
                }, {
                    extend: 'excel',
                    text: '<li class="fas fa-file-excel"></li> EXCEL',
                    titleAttr: 'Exportar a EXCEL',
                    className: 'btn btn-success btn-sm ',
                    filename: nameReport,
                    title: ' ',
                    footer: true,
                    insertCells: [{
                            cells: '2',
                            content: '',
                            pushRow: true
                        }, {
                            cells: 'E2',
                            content: enterprice.nombre
                        }, {
                            cells: '3',
                            content: '',
                            pushRow: true
                        }, {
                            cells: 'B3',
                            content: 'FECHA: '
                        }, {
                            cells: 'C3',
                            content: dateActual
                        }, {
                            cells: 'E3',
                            content: enterprice.direccion
                        }, {
                            cells: 'J3',
                            content: 'Telefono'
                        }, {
                            cells: 'K3',
                            content: enterprice.celular
                        }, {
                            cells: '4',
                            content: '',
                            pushRow: true
                        }, {
                            cells: 'B4',
                            content: 'RUC:'
                        }, {
                            cells: 'C4',
                            content: enterprice.ruc
                        }, {
                            cells: 'E4',
                            content: nameReport + ' ' + varData
                        }, {
                            cells: 'J4',
                            content: 'Email:'
                        }, {
                            cells: 'K4',
                            content: enterprice.email
                        }, {
                            cells: '5',
                            content: '',
                            pushRow: true
                        }, ],
                    exportOptions: {
                        columns: ':visible',
                    },
                }, {
                    extend: 'pdfHtml5',
                    text: '<li class="fas fa-file-pdf"></li> PDF',
                    titleAttr: 'Exportar a PDF',
                    className: 'btn btn-danger btn-sm ',
                    orientation: 'landscape',
                    filename: nameReport,
                    title: ' ',
                    footer: true,
//                    messageTop: '-',
                    //                                messageBottom:'qWD',
                    exportOptions: {
                        columns: ':visible'
                    },
                    customize: function (doc) {
                        doc.content.splice(0, 1);
                        doc.pageMargins = [40, 80, 20, 40];
                        doc.defaultStyle.fontSize = 8;
                        doc.styles.tableHeader.fontSize = 10;
                        var tablecc;
                        for (i = 0; i < doc.content.length; ++i) {
                            if (doc.content[i].table !== undefined) {
                                tablecc = doc.content[i];
                                break;
                            }
                        }
                        var rowIndex = 0;
                        var tableColumnCount = tablecc.table.body[rowIndex].length;
                        if (tableColumnCount > 9) {
                            doc.pageOrientation = 'landscape';
                        }
                        doc['header'] = (function () {
                            return {
                                columns: [
                                    [
                                        {
                                            alignment: 'center',
                                            width: 120,
                                            height: 20,
                                            margin: [10, 2],
                                            image: "data:image/png;base64,"
                                        }, {
                                            alignment: 'center',
                                            text: 'FECHA_IMP: ' + dateActual,
                                            fontSize: 10,
                                            margin: [10, 2]
                                        }, {
                                            alignment: 'center',
                                            text: 'RUC: ' + enterprice.ruc,
                                            fontSize: 10,
                                            margin: [10, 2]
                                        }
                                    ],
                                    [{
                                            alignment: 'center',
                                            fontSize: 14,
                                            text: enterprice.nombre,
                                            margin: [10, 1]
                                        }, {
                                            alignment: 'center',
                                            fontSize: 9,
                                            text: enterprice.direccion
                                        }, {
                                            alignment: 'center',
                                            fontSize: 12,
                                            text: nameReport + ' ' + varData
                                        }, {
                                            alignment: 'center',
                                            fontSize: 12,
                                            text: ' '
                                        }, {
                                            alignment: 'center',
                                            fontSize: 12,
                                            text: ' '
                                        }, {
                                            alignment: 'center',
                                            fontSize: 12,
                                            text: ' '
                                        }],
                                    [{
                                            alignment: 'center',
                                            fontSize: 10,
                                            text: 'Logo2.',
                                            margin: [10, 2]
                                        }, {
                                            alignment: 'center',
                                            fontSize: 10,
                                            text: 'Telefono: ' + enterprice.telefono,
                                            margin: [10, 2]
                                        }, {
                                            alignment: 'center',
                                            fontSize: 10,
                                            text: 'Email: ' + enterprice.email,
                                            margin: [10, 2]
                                        }]
                                ],
                                margin: 6
                            }
                        });
                        doc['footer'] = (function (page, pages) {
                            return {
                                columns: [{
                                        alignment: 'left',
                                        text: ['Creado el: ', {
                                                text: dateActual.toString()
                                            }]
                                    }, {
                                        alignment: 'right',
                                        text: ['pagina ', {
                                                text: page.toString()
                                            }, ' de ', {
                                                text: pages.toString()
                                            }]
                                    }],
                                margin: 20
                            };
                        });
                        var objLayout = {};
                        objLayout['hLineWidth'] = function (i) {
                            return .5;
                        };
                        objLayout['vLineWidth'] = function (i) {
                            return .5;
                        };
                        objLayout['hLineColor'] = function (i) {
                            return '#aaa';
                        };
                        objLayout['vLineColor'] = function (i) {
                            return '#aaa';
                        };
                        objLayout['paddingLeft'] = function (i) {
                            return 4;
                        };
                        objLayout['paddingRight'] = function (i) {
                            return 4;
                        };
                        doc.content[0].layout = objLayout;
                    }
                }, {
                    extend: 'print',
                    text: '<li class="fas fa-print"></li> IMPRIMIR',
                    titleAttr: 'Imprimir Documento',
                    className: 'btn btn-secondary btn-sm',
                    filename: nameReport,
                    footer: true,
                    title: ' ',
                    exportOptions: {
                        columns: ':visible'
                    },
                    customize: function (doc) {
                        $(doc.document.body).prepend(`<table class="table-bordered" style="text-align:center; width:100%">
                                                         <tr>
                                                          <td><img src="` + baseUrl + `/uploads/img/enterprice/logo.png" style="width: 140px;height: 40px"></td>  
                                                          <td><h3>` + enterprice.nombre + `</h3></td>
                                                          <td><img src="` + baseUrl + `/uploads/img/enterprice/banner2.png" style="width: 140px;height: 40px"></td>  
                                                        </tr>
                                                        <tr>
                                                          <td><h5>FECHA_IMP: ` + dateActual + `</h5></td>
                                                          <td><h5>` + enterprice.direccion + `</h5></td>
                                                          <td><h5>Telefono: ` + enterprice.telefono + `</h5></td>
                                                        </tr>
                                                        <tr>
                                                          <td><h5>RUC: ` + enterprice.ruc + `</h5></td>
                                                           <td><h4 class="font-weight-bold">` + nameReport + ' ' + varData + `</h4></td>
                                                          <td><h5>Email: ` + enterprice.email + `</h5></td>
                                                        </tr>
                                                      </table>`);
                        //                                            
                    }
                }],
            drawCallback: function () {
                for (var i = 0; i < dataTable.columns().header().length; i++) {
                    var api = this.api();
                    var num = api.column(i, {page: 'current'}).data().sum();
                    var nun_redondeado = num.toFixed(2);

                    if (nun_redondeado === 'NaN' || nun_redondeado === '0.00') {
                        if (i === 0) {
                            $(api.column(i).footer()).html('TOTALES');
                        } else {
                            $(api.column(i).footer()).html('-');
                        }
                    } else {
                        if (i === 0) {
                            $(api.column(i).footer()).html('TOTALES');
                        } else {
                            $(api.column(i).footer()).html(nun_redondeado);
                        }

                    }

                }

            }
        });
    });
}
